h1 {
  margin: 0;
  font-size: 3em;
  font-weight: 900;
  line-height: 1.25em;
}

h2 {
  font-weight: 500;
}

p,
li {
  font-weight: 300;
  color: #aaa;
  font-size: 0.75em;
  line-height: 1.5em;
}

a {
  text-transform: uppercase;
  text-decoration: none;
  font-weight: 900;
  font-size: 0.75em;
  color: #6EC6B1;
  line-height: 1.5em;
  transition: 0.2s;
}
a:hover {
  transition: 0.2s;
  color: #49b89d;
}

.sprinkles-component {
  background-color: #aaa;
  width: 100vw;
  height: 100vh;
  overflow-y: auto;
  position: relative;
}
.sprinkles-component canvas {
  z-index: 0;
  width: 100vw;
  height: 100vh;
  position: absolute;
  top: 0;
  bottom: 0;
  left: 0;
  right: 0;
}
.sprinkles-component .sprinkles-component {
  z-index: 1;
}
